import React, { useState } from "react";
import { Link } from "react-router-dom";
import "../styles/Login.css";

function Login() {
  const [passwordVisible, setPasswordVisible] = useState(false);

  const togglePasswordVisibility = () => {
    setPasswordVisible(!passwordVisible);
  };

  // Handle form submit (works with Enter key or clicking Login)
  const handleSubmit = (e) => {
    e.preventDefault(); // prevent page refresh
    console.log("Login submitted ✅");
    // TODO: Add your login logic here (API call, validation, etc.)
  };

  return (
    <div className="login-page">
      <div className="login-container">
        <h1>Login</h1>
        {/* Form submission handles Enter key automatically */}
        <form className="login-form" onSubmit={handleSubmit}>
          <input type="email" placeholder="Email" className="login-input" required />

          <div className="password-wrapper">
            <input
              type={passwordVisible ? "text" : "password"}
              placeholder="Password"
              className="login-input password-input"
              required
            />
            <button
              type="button"
              className="toggle-password-btn"
              onClick={togglePasswordVisibility}
            >
              {passwordVisible ? "Hide" : "Show"}
            </button>
          </div>

          {/* Submit button (Enter key triggers this too) */}
          <button type="submit" className="login-btn">Login</button>
        </form>

        <p className="login-footer">
          New to our service? <Link to="/signup"><u>Sign Up Here</u></Link>
        </p>
      </div>
    </div>
  );
}

export default Login;
